import lightkurve as lk

import matplotlib.pyplot as plt

"""# **Data acquisition**
We can get the data directly from mast using lightkurve with ' search_lightcurve ' , we use the ID of the star and mission name or author .. etc.<br>
 Here, we will try to obtain lightcurve of WASP-18 b. <br>
 --> to obtain the id of a planet or star , just enter their name in https://exoplanetarchive.ipac.caltech.edu/index.html then go TOI under tools![Screenshot (111).png](data:image/png;base64,)

 It  will open a new tab contain a lot of information about the planet ![Screenshot (112).png](data:image/png;base64,)
"""

search_result = lk.search_lightcurve('TIC 100100827', mission='TESS')
#search_lightcurve('Id' , mission = '' , author = '' , year = '' , etc......)
search_result.table  #.table to make it less messy

tbl = search_result.table #I wanted to see the latest year correspond to which sector
print(tbl['author','mission', 'year'])

"""I did take data from Sector 02 only (taken in 2018). <br>
**I did not take 2020 or 2023 as there was fewer data**
"""

import numpy as np
sector_index = np.where(search_result.table['mission'] == 'TESS Sector 02')[0]
#  np.where take every row that its column['mission] == 'TESS Sector 02'
search_result[sector_index]

data = search_result[sector_index]
data1 = data[0]  # we want to take data of flux and its error , sap flux , time ..etc

lc = data1.download() #simply download it!
lc

"""# **Periodogram**
1 ) We can use an easy command in lightkurve , it will plot flux with time directly
without any complications and we can also use
lc.plot();
"""

lc.scatter();

"""2 ) periodogram is a power spectrum , it tells us how strong the signals in each period so the highest power is our period!! <br>
-->**to_periodogram(oversample_factor = ??)**
oversample_factor controls the resolution (frequency grid spacing , the higher the number the finer accuracy) , it can take from 1 to 10
"""

pg = lc.to_periodogram(oversample_factor=10)

pg.plot(); #notice!! power vs frequency not the period

pg.plot(view='period', scale='log'); #make it with period and take log scale

#finding the maximum power
pg.period_at_max_power

"""3 ) Phase folding <br> it can fool us and won't notice the second minimum so it is important to fold lightcurve and it is now flux vs phase not time"""

lc.fold(period=pg.period_at_max_power).scatter(); #something wrong right?it is not the right period.. what if we multiply it by 2?

lc.fold(period=4*pg.period_at_max_power, wrap_phase=0.2).scatter(); #here we show two cycles

"""4 ) re-calculate but with range <br>
We know now that the actual period is approximately 2*0.47089264d = 0.94178528
Now we will choose a minimum and maximum closer and closer to the actual period
"""

import astropy.units as u
pg = lc.to_periodogram(minimum_period=0.8*u.day, maximum_period=1.2*u.day, oversample_factor=10)
pg.period_at_max_power

import astropy.units as u
pg = lc.to_periodogram(minimum_period=0.8*u.day, maximum_period=1.0*u.day, oversample_factor=10)
pg.period_at_max_power

import astropy.units as u
pg = lc.to_periodogram(minimum_period=0.8*u.day, maximum_period=0.98*u.day, oversample_factor=10)
pg.period_at_max_power

"""## Starting to diverge from the true period which is 0.94145223±0.00000024"""

import astropy.units as u
pg = lc.to_periodogram(minimum_period=0.8*u.day, maximum_period=1.0*u.day, oversample_factor=10)
closest_per = pg.period_at_max_power
closest_per

lc.fold(period=closest_per, wrap_phase=0.2).scatter();

